import React from "react";
import ".././output.css";

function HeaderText(props) {
  return (
    <div className={`text-${props.position}`}>
      <div
        className={`w-[${props.w}] h-[${props.h}] text-${props.position} text-white text-[${props.textsize}] font-bold font-['Outfit'] leading-10`}
      >
        {props.line1}
      </div>
      {props.line2 && (
        <div
          className={`w-[${props.w}] h-[${props.h}]  text-${props.position} text-white text-${props.textsize} font-bold font-['Outfit'] leading-10`}
        >
          {props.line2.split(" ").slice(0, -1).join(" ")}{" "}
          <span className={`text-[${props.lastColor}]`}>
            {props.line2.split(" ").slice(-1)}
          </span>
        </div>
      )}
    </div>
  );
}

export default HeaderText;
